(18, 3, 2, 'FFF', '<h4 id=\"h4--\">接口描述：</h4>\n<ul>\n<li>获取一条消息(后台)。</li>\n</ul>\n<h4 id=\"h4--url-\"><a class=\"reference-link\" name=\"请求 URL：\"></a>请求 URL：</h4>\n<ul>\n<li><code>http|https://host/api/v1/message/method/get.message.item/</code></li>\n</ul>\n<h4 id=\"h4--\"><a class=\"reference-link\" name=\"请求方式：\"></a>请求方式：</h4>\n<ul>\n<li>GET</li>\n<li>POST</li>\n</ul>\n<h4 id=\"h4--\"><a class=\"reference-link\" name=\"是否授权：\"></a>是否授权：</h4>\n<ul>\n<li>需要授权</li>\n</ul>\n<h4 id=\"h4--\"><a class=\"reference-link\" name=\"业务参数：\"></a>业务参数：</h4>\n<table>\n<thead>\n<tr>\n<th>参数名</th>\n<th>类型</th>\n<th>是否必须</th>\n<th>范围值</th>\n<th>默认值</th>\n<th>示例值</th>\n<th>描述</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>message_id</td>\n<td>integer</td>\n<td>是</td>\n<td>gt:0</td>\n<td>&nbsp;</td>\n<td>8</td>\n<td>消息编号</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"h4--\"><a class=\"reference-link\" name=\"响应参数：\"></a>响应参数：</h4>\n<table>\n<thead>\n<tr>\n<th>参数名</th>\n<th>类型</th>\n<th>是否返回</th>\n<th>示例值</th>\n<th>描述</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>status</td>\n<td>integer</td>\n<td>是</td>\n<td>200</td>\n<td>状态码</td>\n</tr>\n<tr>\n<td>message</td>\n<td>string</td>\n<td>是</td>\n<td>success</td>\n<td>消息信息</td>\n</tr>\n<tr>\n<td>data</td>\n<td>object</td>\n<td>否</td>\n<td>[]</td>\n<td>返回对象</td>\n</tr>\n</tbody>\n</table>\n<table>\n<thead>\n<tr>\n<th>data</th>\n<th>类型</th>\n<th>是否返回</th>\n<th>示例值</th>\n<th>描述</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>message_id</td>\n<td>integer</td>\n<td>是</td>\n<td>8</td>\n<td>消息编号</td>\n</tr>\n<tr>\n<td>type</td>\n<td>integer</td>\n<td>是</td>\n<td>0</td>\n<td>消息类型(自定义)</td>\n</tr>\n<tr>\n<td>member</td>\n<td>integer</td>\n<td>是</td>\n<td>1</td>\n<td>消息成员组 1=顾客组 2=管理组</td>\n</tr>\n<tr>\n<td>title</td>\n<td>string</td>\n<td>是</td>\n<td>活动公告</td>\n<td>消息标题</td>\n</tr>\n<tr>\n<td>content</td>\n<td>string</td>\n<td>是</td>\n<td>活动内容</td>\n<td>消息内容</td>\n</tr>\n<tr>\n<td>url</td>\n<td>string</td>\n<td>是</td>\n<td><a href=\"http://careyshop.cn/\" target=\"_blank\" rel=\"noopener\">http://careyshop.cn</a></td>\n<td>外部链接</td>\n</tr>\n<tr>\n<td>target</td>\n<td>string</td>\n<td>是</td>\n<td>_blank</td>\n<td>打开方式</td>\n</tr>\n<tr>\n<td>page_views</td>\n<td>integer</td>\n<td>是</td>\n<td>0</td>\n<td>游览量</td>\n</tr>\n<tr>\n<td>is_top</td>\n<td>integer</td>\n<td>是</td>\n<td>0</td>\n<td>是否置顶 0=否 1=是</td>\n</tr>\n<tr>\n<td>status</td>\n<td>integer</td>\n<td>是</td>\n<td>1</td>\n<td>消息状态 0=禁用 1=启用</td>\n</tr>\n<tr>\n<td>create_time</td>\n<td>datetime</td>\n<td>是</td>\n<td>2018-06-06 22:49:59</td>\n<td>创建时间</td>\n</tr>\n<tr>\n<td>update_time</td>\n<td>datetime</td>\n<td>是</td>\n<td>2018-06-06 22:49:59</td>\n<td>更新时间</td>\n</tr>\n</tbody>\n</table>\n<h4 id=\"h4--\"><a class=\"reference-link\" name=\"响应示例：\"></a>响应示例：</h4>\n<ol class=\"linenums\">\n<li class=\"L0\"><code class=\"lang-json\"><span class=\"pun\">{</span></code></li>\n<li class=\"L1\"><code class=\"lang-json\">  <span class=\"str\">\"status\"</span><span class=\"pun\">:</span> <span class=\"lit\">200</span><span class=\"pun\">,</span></code></li>\n<li class=\"L2\"><code class=\"lang-json\">  <span class=\"str\">\"message\"</span><span class=\"pun\">:</span> <span class=\"str\">\"success\"</span><span class=\"pun\">,</span></code></li>\n<li class=\"L3\"><code class=\"lang-json\">  <span class=\"str\">\"data\"</span><span class=\"pun\">:</span> <span class=\"pun\">{</span></code></li>\n<li class=\"L4\"><code class=\"lang-json\">    <span class=\"str\">\"message_id\"</span><span class=\"pun\">:</span> <span class=\"lit\">8</span><span class=\"pun\">,</span></code></li>\n<li class=\"L5\"><code class=\"lang-json\">    <span class=\"str\">\"type\"</span><span class=\"pun\">:</span> <span class=\"lit\">0</span><span class=\"pun\">,</span></code></li>\n<li class=\"L6\"><code class=\"lang-json\">    <span class=\"str\">\"member\"</span><span class=\"pun\">:</span> <span class=\"lit\">1</span><span class=\"pun\">,</span></code></li>\n<li class=\"L7\"><code class=\"lang-json\">    <span class=\"str\">\"title\"</span><span class=\"pun\">:</span> <span class=\"str\">\"活动公告\"</span><span class=\"pun\">,</span></code></li>\n<li class=\"L8\"><code class=\"lang-json\">    <span class=\"str\">\"content\"</span><span class=\"pun\">:</span> <span class=\"str\">\"活动内容\"</span><span class=\"pun\">,</span></code></li>\n<li class=\"L9\"><code class=\"lang-json\">    <span class=\"str\">\"url\"</span><span class=\"pun\">:</span> <span class=\"str\">\"http://careyshop.cn\"</span><span class=\"pun\">,</span></code></li>\n<li class=\"L0\"><code class=\"lang-json\">    <span class=\"str\">\"target\"</span><span class=\"pun\">:</span> <span class=\"str\">\"_blank\"</span><span class=\"pun\">,</span></code></li>\n<li class=\"L1\"><code class=\"lang-json\">    <span class=\"str\">\"page_views\"</span><span class=\"pun\">:</span> <span class=\"lit\">0</span><span class=\"pun\">,</span></code></li>\n<li class=\"L2\"><code class=\"lang-json\">    <span class=\"str\">\"is_top\"</span><span class=\"pun\">:</span> <span class=\"lit\">0</span><span class=\"pun\">,</span></code></li>\n<li class=\"L3\"><code class=\"lang-json\">    <span class=\"str\">\"status\"</span><span class=\"pun\">:</span> <span class=\"lit\">1</span><span class=\"pun\">,</span></code></li>\n<li class=\"L4\"><code class=\"lang-json\">    <span class=\"str\">\"create_time\"</span><span class=\"pun\">:</span> <span class=\"str\">\"2018-06-06 22:49:59\"</span><span class=\"pun\">,</span></code></li>\n<li class=\"L5\"><code class=\"lang-json\">    <span class=\"str\">\"update_time\"</span><span class=\"pun\">:</span> <span class=\"str\">\"2018-06-06 23:16:52\"</span></code></li>\n<li class=\"L6\"><code class=\"lang-json\">  <span class=\"pun\">}</span></code></li>\n<li class=\"L7\"><code class=\"lang-json\"><span class=\"pun\">}</span></code></li>\n</ol>\n<h4 id=\"h4--\"><a class=\"reference-link\" name=\"备注:\"></a>备注:</h4>\n<ol>\n<li>当<code>url</code>存在值表示跳转到某个地址，<code>target</code>表示目标打开方式。</li>\n</ol>', '', '_blank', 0, 1, 0, 1, 1555429519, 1555470254),
(19, 2, 1, '纳网13周年庆钜惠来袭，域名享1元，主机建站1折起', '<img src=\"http://image.idosend.com/fkImages/13082/Image/137_01.jpg\" width=\"700\" height=\"284\" />&nbsp;<a href=\"http://image.idosend.com/t/dd71037f/9f7e/4cc8/b57a/82ed895aa9a6/2954558-564378.html\" target=\"_blank\" rel=\"noopener\"><img src=\"http://image.idosend.com/fkImages/13082/Image/137_03.jpg\" width=\"651\" height=\"319\" /></a>&nbsp;&nbsp;<a href=\"http://image.idosend.com/t/1722ba26/fc65/4fee/aba9/af2a49cd95fc/2954558-564378.html\" target=\"_blank\" rel=\"noopener\"><img src=\"http://image.idosend.com/fkImages/13082/Image/137_06.jpg\" width=\"651\" height=\"290\" /></a>&nbsp;<a href=\"http://image.idosend.com/t/16cb48d1/9806/4c3e/b4f3/32ef01c8afbc/2954558-564378.html\" target=\"_blank\" rel=\"noopener\"><img src=\"http://image.idosend.com/fkImages/13082/Image/137_08.jpg\" width=\"651\" height=\"250\" /></a>&nbsp;<img src=\"http://image.idosend.com/fkImages/13082/Image/137_10.jpg\" width=\"700\" height=\"111\" />', '', '_blank', 0, 0, 0, 1, 1555470096, 1555470247),
(20, 0, 2, '奔驰维权女车主和西安利之星4S店达成和解协议', '<p>【消费者购买奔驰新车遭遇发动机漏油最新进展：当事双方已达成和解】4月16日晚， W女士（化名）和西安利之星汽车有限公司达成换车补偿等和解协议。</p>\n<p>此外，记者从西安高新区市场监管部门了解到，涉事车辆有关质量问题已进入鉴定程序，该事件涉及的涉嫌违法违规问题，仍将依法依规进行调查处理，结果将及时向社会公布。同时，根据省市部署，将继续开展汽车销售市场经营行为专项整治工作，依法依规净化市场环境、保护消费者合法权益。</p>\n<p><a href=\"https://c.m.163.com/news/s/S1555048489505.html\" target=\"_blank\" rel=\"noopener\">进入专题&gt;&gt;</a></p>\n<p>&nbsp;</p>\n<div class=\"special_tag_wrap\">\n<div class=\"special_tag special_tag_tj\">\n<div class=\"special_tag_ttl\">延伸 &middot; 推荐</div>\n<div class=\"special_tag_cnt\">\n<p><a href=\"https://news.163.com/19/0417/00/ECU57GGU0001899O.html\" target=\"_blank\" rel=\"noopener\">奔驰女车主与4s店和解：换新车退还金融服务费</a></p>\n<p>16日晚，北青报记者从西安市市场监督管理局高新分局刘副局长处获悉，当晚，维权的奔驰车主王女士和西安利之星汽车有限公司已达成换车、补偿等和解协议。</p>\n</div>\n</div>\n</div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<div class=\"special_tag_wrap\">\n<div class=\"special_tag special_tag_hg\">\n<div class=\"special_tag_ttl\">延伸 &middot; 回顾</div>\n<div class=\"special_tag_cnt\">\n<p><a href=\"https://news.163.com/19/0416/21/ECTORA1F0001899O.html\" target=\"_blank\" rel=\"noopener\">奔驰车主维权调查:利之星收3%服务费获利2/3</a></p>\n<p>据税务部门的工作人员介绍，车主所交的&ldquo;金融服务费&rdquo;，实际上是第三方陕西元胜公司派驻在西安利之星4S店的工作人员收取的。</p>\n<p><a href=\"https://news.163.com/19/0416/18/ECTGEMV40001899O.html\" target=\"_self\">奔驰公司:已与车主沟通 将暂停涉事授权店销售运营</a></p>\n<p>针对西安奔驰车漏油、车主维权一事，4月16日下午，北京梅赛德斯-奔驰销售服务有限公司发布情况说明。表示将对相关经销商的经营合规性展开调查。结果明确前，该授权店的销售运营将暂停，立即执行。</p>\n</div>\n</div>\n</div>\n<p class=\"f_center\"><img src=\"http://cms-bucket.ws.126.net/2019/04/17/1f7692db33f6484696660f9d5de82808.jpeg?imageView&amp;thumbnail=550x0\" alt=\"奔驰维权女车主和西安利之星4S店达成和解协议\" /></p>', '', '_blank', 0, 0, 1, 0, 1555470175, 1555678321),
