(53, 0, 2, '奔驰维权女车主和西安利之星4S店达成和解协议', '<p>【消费者购买奔驰新车遭遇发动机漏油最新进展：当事双方已达成和解】4月16日晚， W女士（化名）和西安利之星汽车有限公司达成换车补偿等和解协议。</p>\n<p>此外，记者从西安高新区市场监管部门了解到，涉事车辆有关质量问题已进入鉴定程序，该事件涉及的涉嫌违法违规问题，仍将依法依规进行调查处理，结果将及时向社会公布。同时，根据省市部署，将继续开展汽车销售市场经营行为专项整治工作，依法依规净化市场环境、保护消费者合法权益。</p>\n<p><a href=\"https://c.m.163.com/news/s/S1555048489505.html\" target=\"_blank\" rel=\"noopener\">进入专题&gt;&gt;</a></p>\n<p>&nbsp;</p>\n<div class=\"special_tag_wrap\">\n<div class=\"special_tag special_tag_tj\">\n<div class=\"special_tag_ttl\">延伸 &middot; 推荐</div>\n<div class=\"special_tag_cnt\">\n<p><a href=\"https://news.163.com/19/0417/00/ECU57GGU0001899O.html\" target=\"_blank\" rel=\"noopener\">奔驰女车主与4s店和解：换新车退还金融服务费</a></p>\n<p>16日晚，北青报记者从西安市市场监督管理局高新分局刘副局长处获悉，当晚，维权的奔驰车主王女士和西安利之星汽车有限公司已达成换车、补偿等和解协议。</p>\n</div>\n</div>\n</div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<div class=\"special_tag_wrap\">\n<div class=\"special_tag special_tag_hg\">\n<div class=\"special_tag_ttl\">延伸 &middot; 回顾</div>\n<div class=\"special_tag_cnt\">\n<p><a href=\"https://news.163.com/19/0416/21/ECTORA1F0001899O.html\" target=\"_blank\" rel=\"noopener\">奔驰车主维权调查:利之星收3%服务费获利2/3</a></p>\n<p>据税务部门的工作人员介绍，车主所交的&ldquo;金融服务费&rdquo;，实际上是第三方陕西元胜公司派驻在西安利之星4S店的工作人员收取的。</p>\n<p><a href=\"https://news.163.com/19/0416/18/ECTGEMV40001899O.html\" target=\"_self\">奔驰公司:已与车主沟通 将暂停涉事授权店销售运营</a></p>\n<p>针对西安奔驰车漏油、车主维权一事，4月16日下午，北京梅赛德斯-奔驰销售服务有限公司发布情况说明。表示将对相关经销商的经营合规性展开调查。结果明确前，该授权店的销售运营将暂停，立即执行。</p>\n</div>\n</div>\n</div>\n<p class=\"f_center\"><img src=\"http://cms-bucket.ws.126.net/2019/04/17/1f7692db33f6484696660f9d5de82808.jpeg?imageView&amp;thumbnail=550x0\" alt=\"奔驰维权女车主和西安利之星4S店达成和解协议\" /></p>', '', '_blank', 0, 0, 1, 0, 1555470175, 1555678321),
