(104, 0, 2, '全景视觉起诉微博用户使用\"孔子画像\"索赔万元 遭法院驳回', '<div>\n<p><img title=\"版权 (2)(1)\" src=\"https://upload.chinaz.com/picmap/201904150932294132_5.jpg\" alt=\"版权 (2)(1)\" /></p>\n<p>图片版权所属：站长之家</p>\n<p><strong>站长之家(ChinaZ.com) 4月23日 消息:</strong>据新京报报道，日前，广州越秀区人民法院发布了一份涉知识产权的白皮书。其中一起典型案例中，原告全景视觉起诉一公司称，对方的微博用了其图库中的孔子画像摄影图片，要求对方停止侵权、公开赔礼道歉、赔偿经济损失 1 万元。</p>\n<p>对此，越秀法院审理认为，该拍摄过程和拍摄成果，不具有新的艺术性和审美意义。涉案照片不具有独创性，不属于受著作权法保护的作品，故驳回全部诉讼请求。</p>\n<br /><br />著作权归作者所有。<br />商业转载请联系作者获得授权，非商业转载请注明出处。<br />作者：站长之家编辑 <br />链接：https://www.chinaz.com/2019/0423/1011401.shtml <br />来源：站长之家</div>', '', '_blank', 2, 1, 1, 0, 1556031118, 1556031118),
(105, 1, 2, 'OPPO签约温网5年背后：全球市场一盘棋', '<div>\n<p><img title=\"Oppo logo\" src=\"https://upload.chinaz.com/picmap/201811191339516597_0.jpg\" alt=\"Oppo logo\" /></p>\n<p>图片版权所属：站长之家</p>\n<p>崔玉贤/文</p>\n<p>进入 2019 年，正当市场对今年手机市场略显悲观的时候，OPPO却&ldquo;逆周期&rdquo;地频频操作：先是发布全球统一全新品牌标志，后又发布全新产品系列Reno;今天更是携手了一项全球顶级赛事IP：温布尔登网球锦标赛，也就是大家俗称的&ldquo;温网&rdquo;。</p>\n<p>英国时间 4 月 25 日(北京时间 4 月 26 日)， OPPO与全英草地网球俱乐部在温布尔登共同宣布，OPPO正式成为温布尔登网球锦标赛全球合作伙伴，也是温网全球唯一的手机行业合作伙伴和唯一的亚洲合作伙伴。</p>\n<p>温网是目前全球最悠久的网球赛事，虽历经百年，仍有着无限生机，也被称为最纯洁、最优雅的大满贯赛事，因为你在温网看不到铺天盖地的赞助商标识，仿佛这些赞助商来到了温网，也透露一丝优雅的气息。在即将到来的 2019 赛季，你将会看到OPPO与劳力士、捷豹、IBM等品牌一同出现在温网赛程。</p>\n<p><strong>四个月努力撬动温网 双方一拍即合</strong></p>\n<p>根据双方透露，OPPO与温网达成了 5 年的合作关系，双方将会有深度的内容共创，包括定制化的内容，以及在转播中出现的OPPO Moment捕捉精彩比赛瞬间和品牌展现。此外，有一个合作细节十分值得留意，双方合作特别为温网特别设立了&ldquo;OPPO突破明星奖&rdquo;，用以褒奖那些才华横溢的年轻球员，不禁让人联想起OPPO一直倡导的&ldquo;大胆启用年轻人&rdquo;。</p>\n<p>双方之所以能够成功牵手，温网看重的是OPPO在新千禧一代中的影响力。事实上，温网近些年来自身也一直在寻求突破，从其&ldquo;In Pursuit of Greatness&rdquo;(追逐伟大)的宣传主题即可以看出，此次或许可以看作温网希望通过与OPPO这样一个年轻科技品牌，能够给这个百年品牌带来更多活力。</p>\n<p>这样重量级别的合作，肯定并非一夜之间达成。当网易科技向OPPO相关人员处了解双方合作细节时，OPPO方面表示&ldquo;我们了解、接触了将近 4 个月，最终达成了合作。&rdquo;此外，OPPO还透露，双方从初次见面时就有了合作意向，并最终顺利达成此次合作。</p>\n<p>由此可见，OPPO在产品之外的品牌维度，已经在全球慢慢被认可;而对于OPPO来说，选择温网可以看做成其将全球视为一个市场的商业哲学背后，进一步开拓海外市场的重要举措。</p>\n<p><strong>全球市场一盘棋 渐变之后的&ldquo;新OPPO&rdquo;</strong></p>\n<p>早在十年前，OPPO就开始了海外市场的征途。十年时间，业务发展成绩得到了行业内外的肯定，现在已经覆盖了已经覆盖了全球 40 多个国家和地区，并在去年进入欧洲市场。</p>\n<p>在屡次面对媒体关于OPPO如何看待海外和中国市场时候，OPPO副总裁沈义人总是这样对媒体说：&ldquo;对我们来说并没有所谓的海外市场和中国市场之分，因为我们始终把全球当做一个市场对待。&rdquo;</p>\n<p>今年是OPPO自己界定的手机业务新十年第一年，OPPO以品牌国际化，运营本地化两者协同，继续将全球为同一个市场，加速全球化品牌建设的步伐。与温网合作，毫无疑问是OPPO&ldquo;全球一个市场&rdquo;策略的新体现。</p>\n<p>除此之外，为了更好的面对这个全球市场，就有了开篇的内容，新的品牌标识、新的产品系列、甚至是新的字体。在北京的朋友，有时间可以去转转OPPO北京超级旗舰店，相信你会有&ldquo;耳目一新&rdquo;的感觉。</p>\n<p><strong>手机厂商&ldquo;出海&rdquo;凭什么? Glocal是&ldquo;指南针&rdquo;</strong></p>\n<p>熟悉手机行业的一定知道，国内手机市场整体发展近年来逐步放缓，并在近两年呈现下跌趋势。分析机构IDC的数据显示， 2018 年全年国内智能机整体市场出货量下滑超过10%。在国内手机市场容量接近天花板时，中国手机厂商纷纷将视线移向海外，品牌走出去、产品走出去、从而寻求让业务长上去。</p>\n<p>根据WPP联合Google发布的《 2019 年BrandZ中国出海品牌 50 强报告》显示，国产品牌在国外影响力比较高的几乎都是科技品牌，而且很多都是手机厂商：华为、OPPO、小米、一加等等。为了维持和加强各自品牌在海外市场的表现，各家厂商一刻不停。这其中，OPPO用不同于国内的发展路径，率先打响了开门红。</p>\n<div id=\"ad_1104309\" class=\"otherContent_01\">&nbsp;</div>\n<p>回顾OPPO在国内的发展路径，主要是通过产品和品牌同步驱动OPPO品牌发展。让消费者通过对产品的认知，产生对OPPO品牌的认知。而在国外市场，OPPO高举高打，利用品牌先行率先树立OPPO的品牌形象。从去年在法国举办发布会，到今年在西班牙举办创新大会，OPPO正在主动向外媒释放企业先进的技术和产品信息，以塑造自身的科技品牌形象。</p>\n<p>&nbsp;</p>\n<p>但不得不承认的是，中国的品牌走上全球舞台时候，似乎我们的企业品牌总是&ldquo;犹抱琵琶半遮面&rdquo;，海外市场似乎认识，又似乎不认识。正因为如此，OPPO大刀阔斧在全球范围内统一更新了品牌视觉，用全新的视觉风格，演绎出OPPO更科技感、更现代的品牌形象。而爆款R系列停止更新，新系列Reno登上舞台，正是面向全球消费者专门设计的一款产品，让消费者对从品牌、产品都有一个统一的认识重要举措。</p>\n<p>回到温网上来，温网曾表示，赛事的合作伙伴要完全符合自己的品牌气质，并且总数不会超过 15 个。对于公认的&ldquo;全球体育大IP&rdquo;，OPPO携手温网，可以说是其&ldquo;Glocal&rdquo;策略，即&ldquo;品牌国际化，运营本地化&rdquo;策略的重要实践。</p>\n<br /><br />著作权归作者所有。<br />商业转载请联系作者获得授权，非商业转载请注明出处。<br />作者：站长之家编辑 <br />链接：https://www.chinaz.com/news/2019/0426/1012456.shtml <br />来源：站长之家</div>', '', '_blank', 1, 1, 1, 0, 1556295190, 1556295215),
