(111, 3, 2, '《控制》工作室回应Xbox玩家出离愤怒：PS4独占内容不会很久', '<p>此前，我们曾经报道过，由于Remedy工作室的新作《<a href=\"https://www.3dmgame.com/games/control/\" target=\"_blank\" rel=\"noopener\">控制</a>》在PS4上过多的独占内容，<a href=\"https://www.3dmgame.com/news/201904/3759806.html\" target=\"_blank\" rel=\"noopener\">Xbox玩家们在Reddit上出离愤怒</a>。近日，Remedy工作室的公关主管Thomas Puha在与外媒Wccftech的交谈中，被问到了《控制》PS4独占内容时长的问题，Thomas Puha表示，Xbox和PC玩家不会等很久的。</p>\n<p align=\"center\"><img src=\"https://img.3dmgame.com/uploads/images/news/20190516/1557969063_467978.jpg\" alt=\"《控制》工作室回应Xbox玩家出离愤怒：PS4独占内容不会很久\" /></p>\n<p>在与外媒Wccftech的交谈中，被问及PS4独占内容将会持续多久时，Remedy工作室的公关主管Thomas Puha说：&ldquo;PS4数字豪华版《控制》确实有一个独占任务，季票内容也与它紧密相连。但除了一个特定服装、一些直线任务和数字主题之外，剩下的内容全平台都是一样的。而且全平台也都支持季票，我不能准确地告诉大家PS4会独占这些内容多长时间，但是不会很久的。大家要知道，我们这些人在Remedy里也是消费者，大家玩到游戏的核心部分都是一样的，再者发行商们会因为一些商业原因做一些决定。&rdquo;</p>\n<p>虽然Remedy工作室的公关主管Thomas Puha表示，PS4的独占内容不会持续很久，但他似乎也暗示过多独占内容这件事不是由Remedy决定的，所以现在还还不确定。</p>\n<p>Remedy新作《控制》将于2019年8月27日发售，登陆PS4/Xbox One和PC平台，PC版将由Epic独占一年。</p>', '', '_blank', 6, 0, 1, 0, 1557970318, 1557970318),
(112, 3, 2, 'ofo欠债2.5亿多名高管成老赖 法院:已无可执行财产', '<p class=\"otitle\">（原标题：15楼财经 | 2.5亿标的无法执行曝光ofo秘密 法院：名下已&ldquo;无财产&rdquo;）</p>\n<p>&nbsp;</p>\n<p>日前，一份来自天津市高级人民法院的裁判文书显示，天津富士达自行车工业有限公司（天津富士达）因买卖合同纠纷向ofo的运营主体东峡大通（北京）管理咨询有限公司申请执行2.5亿的标的。不过，法院认定，ofo已&ldquo;无财产&rdquo;，其名下无房产及土地使用权、无对外投资、无车辆，虽开设了银行账户，但已被其他法院冻结或账户无余额。此前，ofo的多名管理人员包括陈正江、戴威、杨品杰、陈婧等已被作为失信被执行人限制高消费。</p>\n<p><strong>现状</strong></p>\n<p><strong>法院认定ofo名下已无可供执行财产</strong></p>\n<p class=\"f_center\"><img src=\"http://cms-bucket.ws.126.net/2019/06/18/8cd8fd8b20cb47068b94e8116557549e.jpeg\" alt=\"ofo欠债2.5亿多名高管成老赖 法院:已无可执行财产\" width=\"600\" height=\"400\" /></p>\n<p>今年，天津市高级人民法院曾作出调解，天津富士达与东峡大通的一份民事调解书已经发生法律效力。不过，因东峡大通迟迟不履行义务，天津富士达向天津市高级人民法院申请执行。申请执行标的为人民币2.498亿元。</p>\n<p>法院在裁定书中表示，ofo方面向法院报告了财产，其名下无房产及土地使用权、无对外投资、无车辆，虽开设了银行账户，但已被其他法院冻结或账户无余额。</p>\n<p>通过最高人民法院&ldquo;总对总&rdquo;查控系统对被执行人名下财产进行了查询，系统反馈查询信息为&ldquo;无财产&rdquo;。到被执行人住所地的不动产登记部门、市场监督管理部门、公安车辆管理部门进行传统查控，被执行人名下无可供执行财产。申请执行人亦无被执行人的财产线索提供，本院亦已对被执行人申报的财产进行核对，无财产可供执行，本院已向被执行人发出限制消费令。</p>\n<p>最终，法院裁定终结本次执行程序。申请执行人发现被执行人有可供执行财产的，可以再次申请执行。</p>\n<p><strong>动态</strong></p>\n<p><strong>ofo法定代表人因不履行12万元判决被限制出境</strong></p>\n<p class=\"f_center\"><img src=\"http://cms-bucket.ws.126.net/2019/06/18/a0742147fb3a42b99e99226c29e469a1.jpeg\" alt=\"ofo欠债2.5亿多名高管成老赖 法院:已无可执行财产\" width=\"600\" height=\"400\" /></p>\n<p>6月12日，来自上海市高级人民法院网的信息显示，被执行人东峡大通（北京）管理咨询有限公司，因不履行法律文书确定的义务，法院已依法限制其影响债务履行的直接责任人陈正江出境。并请执行联动机制成员单位，基层协助执行网络成员和社会公众协助法院执行。</p>\n<p>陈正江是东峡大通公司的法定代表人，同时还担任东峡大通全资子公司成都智客出行科技有限公司的法定代表人。</p>\n<p>案件信息显示，该案案号为（2019）沪0110执1121号，申请执行人为仵金科，执行标的为12万元，失信被执行人行为具体情形为：有履行能力而拒不履行生效法律文书确定义务。北青报记者从企查查看到，2018年8月和12月，仵金科与东峡大通（北京）管理咨询有限公司因生命权、健康权、身体权纠纷两次开庭。</p>\n<p><strong>发现</strong></p>\n<p><strong>东峡大通170条执行文书 一个月标的超6000万</strong></p>\n<p class=\"f_center\"><img src=\"http://cms-bucket.ws.126.net/2019/06/18/c6c925ac3d7c491a86098313f866bca3.jpeg\" alt=\"ofo欠债2.5亿多名高管成老赖 法院:已无可执行财产\" width=\"600\" height=\"381\" /></p>\n<p>北青报记者看到，目前在中国执行信息公开网上，东峡大通公司相关的执行文书有170条，大部分的执行时间都在2019年1月以后，被执行标的金额十分巨大。仅今年5月，东峡大通就收到来自北京海淀、北京朝阳、北京丰台、杭州市、天津市、厦门市、上海市等多个法院的近20件执行文书。仅一个月的执行标的，就超过6000万元。</p>\n<p>同时，东峡大通被冻结股权标的6起，被冻结股权超过1700万元。不过，东峡大通(北京)管理咨询有限公司的注册资本达到150000万美元，也就是15亿美元。</p>\n<p><strong>聚焦</strong></p>\n<p><strong>包括ofo创始人戴威在内多名高管成失信被执行人</strong></p>\n<p class=\"f_center\"><img src=\"http://cms-bucket.ws.126.net/2019/06/18/b8c059ebe80a49cdb3b6872635740c4c.jpeg\" alt=\"ofo欠债2.5亿多名高管成老赖 法院:已无可执行财产\" width=\"600\" height=\"400\" /></p>\n<p>在中国执行信息公开网上，陈正江本人已有16条被列为失信人被限制高消费的信息。</p>\n<p>北青报记者还发现，ofo的多名主要管理人员也都被列入了失信被执行人。创始人戴威有16条被列为执行人被限制高消费的信息；ofo联合创始人杨品杰、ofo总经理陈婧也于2019年4月30日被列入失信被执行人。</p>\n<p>按照规定，被采取限制消费措施后，不得有以下高消费及非生活和工作必需的消费行为：乘坐交通工具时，选择飞机、列车软卧、轮船二等以上舱位；在星级以上宾馆、酒店、夜总会、高尔夫球场等场所进行高消费；购买不动产或者新建、扩建、高档装修房屋；租赁高档写字楼、宾馆、公寓等场所办公；购买非经营必需车辆；旅游、度假；子女就读高收费私立学校；支付高额保费购买保险理财产品；乘坐G字头动车组列车全部座位、其他动车组列车一等以上座位等其他非生活和工作必需的消费行为。</p>', '', '_blank', 0, 0, 0, 0, 1560868254, 1560868254),
